import React from "react";

import ExpenseItem from "./ExpenseItem";
import Card from "../UI/Card";
import "./Expenses.css";

const Expenses = (props) => {
  return (
    <div>
      <Card className="expenses">
        {props.items.map((ele) => {
          <ExpenseItem
            id={ele.id}
            key={ele.id}
            title={ele.title}
            date={ele.date}
            amount={ele.amount}
          />;
        })}
      </Card>
    </div>
  );
};

export default Expenses;
